import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'flex-start',
      justifyContent: 'center',
    },
    largeHeading: {
        fontSize: 30,
        fontStyle: 'bold'
    },
    listContainer: {
        flexGrow: 0,
        flexShrink: 0
    }
  });

  export default styles;
